import './Navbar.css'

class Navbar extends Component(){
    state= {clicked:false};
    render(){
    return(
        <nav>
            <a className ="logo" href="https://www.google.com/">Logo</a>
            <div className='navlis'>
                <ul className='navbar'>
                    <li><a className="active" href="https://www.google.com/">Home</a></li>
                    <li><a href="https://www.google.com/">About</a></li>
                    <li><a href="https://www.google.com/">Grounds</a></li>
                    <li><a href="https://www.google.com/">Login</a></li>
                </ul>
            </div>
            <div id='mobile'>
            <i id='bar' className= {this.state.clicked ? 'fas fa-times' : 'fas fa-bars'}></i>
            </div>
        </nav>
    )
}
}
export default Navbar
